import styled from "styled-components";
import "./App.css";
import { Route, Switch } from "react-router-dom";
import Home from "./page/home";

const Container = styled.div`
  border: 1px solid black;
`;
function App() {

  return (
    <Container>
      <header>
        <h1>App.js - App-Async-Redux</h1>
      </header>
    </Container>
  );
}

export default App;
